    let history = useHistory();  
    const abc = () => {
       console.log("go")
       history.push("/address");
    }
    // abc();

    var totalPrice=0;

    data?.forEach(item =>{
        console.log(item)
        totalPrice += item.price*item.quantity;
    })

    return (
        <SubtotalContainer>
            <MainTotalContainer>

                <PriceContainer>
                    <PriceTitle>Price Details</PriceTitle>
