                <PriceContainer>
                    <PriceDetails>Discounts:</PriceDetails>
                    <PriceDetails>400/-</PriceDetails>
                </PriceContainer>



            </MainTotalContainer>

            <PriceContainer>
                    <PriceTitle>Order Totals:</PriceTitle>
                    <PriceTitle>â‚¹1000/-</PriceTitle>
                </PriceContainer>

            <PriceContainer>
                <Button onClick={abc}>Continue</Button>
            </PriceContainer>

        </SubtotalContainer>

    )
}

export default SubtotalElement;
